import { createSlice } from '@reduxjs/toolkit/dist/createSlice';

const initialState = {
  accessToken: 0,
  refreshToken: 0,
};

export const loginSlice = createSlice({
  name: 'login',
  initialState: initialState,
  reducers: {},
});

export const { } = filterSlice.actions;

export default filterSlice.reducer;
